import React from 'react';
import { Typography, Box } from '@mui/material';

function Annotations({ jsonData }) {
  return (
    <Box>
      <Typography variant="h5">Annotations</Typography>
      <ul>
        {jsonData.annotations.map((annotation, index) => (
          <li key={index}>
            <Typography>
              <strong>Image ID:</strong> {annotation.image_id}, 
              <strong>Category ID:</strong> {annotation.category_id}, 
              <strong>Segmentation:</strong> {annotation.segmentation}
            </Typography>
          </li>
        ))}
      </ul>
    </Box>
  );
}

export default Annotations;
